import { SendMessage } from "./sendmessage"

//chathez kell
export function MindenkinekUzenet(){
    useEffect(() => {
        fetch(`https://localhost:44317/api/Cseveges`)
            .then(response => {
                return response.json()
            })
            .then(data => {
                var user = JSON.parse(localStorage.getItem("user")).Felhasznalonev
                data.forEach(element => {
                    if (user != element.Felhasznalonev) {
                        SendMessage(element.Felhasznalonev, "", true, true)
                    }
                });
            })
    })
}
